function initVoiceSearch() {
    // ,    WebOS   
    if (typeof webOS !== 'undefined' && webOS && webOS.service && webOS.service.voice) {
        try {
            //     
            const voiceSearchButton = document.createElement('button');
            voiceSearchButton.className = 'ai-search-voice-button';
            voiceSearchButton.innerHTML = '';
            voiceSearchButton.title = ' ';
            voiceSearchButton.style.cssText = `
                position: absolute;
                right: 10px;
                top: 50%;
                transform: translateY(-50%);
                background: transparent;
                border: none;
                font-size: 18px;
                cursor: pointer;
                z-index: 10;
            `;

            //      
            const searchInput = document.querySelector('.ai-search-input');
            if (searchInput) {
                searchInput.style.paddingRight = '40px';
                searchInput.parentNode.style.position = 'relative';
                searchInput.parentNode.appendChild(voiceSearchButton);

                //      
                voiceSearchButton.addEventListener('click', function() {
                    startVoiceRecognition();
                });
            }

            console.log('    WebOS');
        } catch (error) {
            console.error('   :', error);
        }
    }
}

//     
function startVoiceRecognition() {
    try {
        if (typeof webOS !== 'undefined' && webOS.service.voice) {
            //     
            webOS.service.voice.start({
                onStart: function() {
                    console.log('  ');
                    showVoiceSearchStatus(' ...');
                },
                onSuccess: function(transcript) {
                    console.log(' :', transcript);
                    processVoiceInput(transcript);
                    hideVoiceSearchStatus();
                },
                onError: function(error) {
                    console.error('  :', error);
                    showVoiceSearchStatus('  ');
                    setTimeout(hideVoiceSearchStatus, 3000);
                }
            });
        } else {
            //     
            startAlternativeVoiceRecognition();
        }
    } catch (error) {
        console.error('    :', error);
        showVoiceSearchStatus('   ');
        setTimeout(hideVoiceSearchStatus, 3000);
    }
}

//      
function startAlternativeVoiceRecognition() {
    if ('webkitSpeechRecognition' in window || 'SpeechRecognition' in window) {
        const SpeechRecognition = window.SpeechRecognition || window.webkitSpeechRecognition;
        const recognition = new SpeechRecognition();
        
        recognition.continuous = false;
        recognition.interimResults = false;
        recognition.lang = 'ru-RU';

        recognition.onstart = function() {
            console.log('   ( )');
            showVoiceSearchStatus(' ...');
        };

        recognition.onresult = function(event) {
            const transcript = event.results[0][0].transcript;
            console.log(' :', transcript);
            processVoiceInput(transcript);
            hideVoiceSearchStatus();
        };

        recognition.onerror = function(event) {
            console.error(' :', event.error);
            showVoiceSearchStatus('  ');
            setTimeout(hideVoiceSearchStatus, 3000);
        };

        recognition.onend = function() {
            hideVoiceSearchStatus();
        };

        recognition.start();
    } else {
        showVoiceSearchStatus('      ');
        setTimeout(hideVoiceSearchStatus, 3000);
    }
}

//      
function processVoiceInput(transcript) {
    try {
        const searchInput = document.querySelector('.ai-search-input');
        if (searchInput) {
            //     
            searchInput.value = transcript;
            
            //   input   
            const inputEvent = new Event('input', { bubbles: true });
            searchInput.dispatchEvent(inputEvent);
            
            //   
            setTimeout(() => {
                const searchButton = document.querySelector('.ai-search-button');
                if (searchButton) {
                    searchButton.click();
                }
            }, 500);
        }
    } catch (error) {
        console.error('   :', error);
    }
}

//      
function showVoiceSearchStatus(message) {
    //     
    let statusElement = document.querySelector('.ai-voice-search-status');
    if (!statusElement) {
        statusElement = document.createElement('div');
        statusElement.className = 'ai-voice-search-status';
        statusElement.style.cssText = `
            position: fixed;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            background: rgba(0, 0, 0, 0.8);
            color: white;
            padding: 20px 30px;
            border-radius: 10px;
            z-index: 10000;
            font-size: 16px;
            text-align: center;
        `;
        document.body.appendChild(statusElement);
    }
    
    statusElement.textContent = message;
    statusElement.style.display = 'block';
}

//      
function hideVoiceSearchStatus() {
    const statusElement = document.querySelector('.ai-voice-search-status');
    if (statusElement) {
        statusElement.style.display = 'none';
    }
}

//  CSS    
function addVoiceSearchStyles() {
    const style = document.createElement('style');
    style.textContent = `
        .ai-search-voice-button:hover {
            opacity: 0.7;
            transform: translateY(-50%) scale(1.1);
        }
        
        .ai-search-voice-button:active {
            transform: translateY(-50%) scale(0.95);
        }
        
        .ai-voice-search-status {
            transition: opacity 0.3s ease;
        }
    `;
    document.head.appendChild(style);
}

//      
document.addEventListener('DOMContentLoaded', function() {
    setTimeout(() => {
        initVoiceSearch();
        addVoiceSearchStyles();
    }, 2000);
});

//      
if (document.readyState === 'loading') {
    document.addEventListener('DOMContentLoaded', initVoiceSearch);
} else {
    initVoiceSearch();
}




